`,"In 1958 Sheikh Rashid bin Saeed became ruler of Dubai. His rise to power found Dubai at a crossroads. During his years of reign, Dubai’s fortunes were reversed by the discovery of oil and oil industry became the main source of income for the emirate. Sheikh Rashid fully appreciated the God given gift of oil and used it for the betterment of Dubai and its people, but at the same time he realized that oil was coming with an expiration date on it. To paraphrase his words “my grandfather and father rode a camel, I’m riding a Mercedes, my children and grandchildren will ride a Range Rover, but my great-grandchildren will go back to the camel”. With that in mind, Sheikh Rashid laid the foundations of a modern and prosperous Dubai.",`

